import React from 'react';
import Home_back from './../img/Home_back.jpg';
import './../css/Home.css';

function Home() {
    return (
        <div>
            <div className='background'>
            <img src={Home_back} alt="Home_back" style={{width:"80%", height:"70%"}}/>
                <div className='upper'>
                    <p>Get your digital issues shorted today!</p>
                </div>
                <div className='middle'>
                    <h3>We help Organizations or an <br />
                        Individual to be Digital </h3>
                </div>
                <div className='lower'>
                    <p>We provide every element needed by an <br />individual or an organization to keep their <br />
                        digital presence alive.</p>
                </div>
            </div>
        </div>
    )
}

export default Home;
